function getImageUrls(){var img=document.getElementsByClassName("kijibox")[0].getElementsByTagName("p"),urls=[];try{for(var i=1;i<img.length-1;i++){var temp=img[i].getElementsByTagName("img")[0].srcset.split(","),temp2=img[i].getElementsByTagName("img")[0].srcset.split(","),result;for(j in temp)temp[j]=temp[j].split(" ")[1].split("w")[0];var result=0;for(j in temp)temp[j]>temp[result]&&(result=j);urls.push(temp2[result].split(" ")[1])}}catch{for(var i=1;i<img.length-1;i++)urls.push(img[i].getElementsByTagName("a")[0].href)}return urls}